import './App.css';
import Sidenav from './Sidenav';
import {Routes, Route, BrowserRouter} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <>
      <BrowserRouter>
        <Routes>
          <Sidenav/>
        </Routes>
      </BrowserRouter>
      </>
    </div>
  );
}

export default App;
